import './SignIn-SignUp.styles.css';
import SignIn from '../../components/SignIn/SignIn.component';

const SignInSignUp = () => {
    return(
        <div className="sign-in-sign-up">
            <SignIn/>
        </div>
    )
}

export default SignInSignUp;
